import { createRouter, createWebHistory } from 'vue-router'

import Lista1View from '@/views/Lista1View'
import Lista2View from '@/views/Lista2View'
import ContactoView from '@/views/ContactoView'
import SpaceView from '@/views/space/SpaceView'
import ItemA from '@/components/items/ItemA'
import ItemB from '@/components/items/ItemA'
import ItemC from '@/components/items/ItemA'


const routes = [
  {
    path: '/url1',
    component: Lista1View,
    name: 'lista-1'
  },
  {
    path: '/url2',
    component: Lista2View,
    name: 'lista-2'
  },
  {
    path: '/url3',
    component: ContactoView,
    name: 'lista-3'
  },
  {
    path: '/space',
    component: SpaceView,
    name: 'space',
    children: [
      {
        path: 'item-a',
        component: ItemA,
        name: 'item-a'
      },
      {
        path: 'item-b',
        component: ItemB,
        name: 'item-b'
      },
      {
        path: 'item-c',
        component: ItemC,
        name: 'item-c'
      }

    ]
  },
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
